// we use JSON.parse here instead of just loading it as a javascript object literal
// because according to https://v8.dev/blog/cost-of-javascript-2019#json that is faster
mergeI18nTranslations(JSON.parse("{\"ar\":{\"account_settings_fe083453\":\"إعدادات الحساب\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"يجب تكوين التنبيهات للمؤسسة. التنبيهات هي ميزة نادرة الاستخدام مصممة لإرسال تنبيه إلى الطلاب أو المعلمين أو المسؤولين لأسباب محددة (مثل عدم وجود تفاعل من الطالب-المعلم لمدة 7 أيام). يتم فحصها كل يوم، وسيتم إرسال الإعلامات للطالب و/أو للمعلم حتى يتم حل المشكلة السبب.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"للسماح للمستخدم بتكوين تنبيهات في إعدادات المساق.\",\"course_settings_f6d0bbf8\":\"إعدادات المساق\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"هذا إعداد حساب يجب تمكينه بواسطة مدير نجاح العملاء. التنبيهات هي ميزة نادرة الاستخدام مصممة لإرسال تنبيه إلى الطلاب أو المعلمين أو المسؤولين لأسباب محددة (مثل عدم وجود تفاعل من الطالب-المعلم لمدة 7 أيام). يتم فحصها كل يوم، وسيتم إرسال الإعلامات للطالب و/أو للمعلم حتى يتم حل المشكلة السبب.\"},\"ca\":{\"account_settings_fe083453\":\"Configuració del compte\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Cal configurar els avisos per a la institució. Els avisos són una característica que no es fa servir gaire, dissenyada per enviar un avís als estudiants, professors o administradors sobre disparadors concrets (p. ex., cap interacció entre estudiant i professor durant 7 dies). Aquests es comproven cada dia, i s’enviaran notificacions a l’estudiant i/o el professor fins que es resolgui el problema que ho ha disparat.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Permet a l’usuari configurar avisos a Configuració del curs.\",\"course_settings_f6d0bbf8\":\"Configuració del curs\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Un administrador d’èxit del client ha d’habilitar aquest paràmetre del compte. Els avisos són una característica que no es fa servir gaire, dissenyada per enviar un avís als estudiants, professors o administradors sobre disparadors concrets (p. ex., cap interacció entre estudiant i professor durant 7 dies). Aquests es comproven cada dia, i s’enviaran notificacions a l’estudiant i/o el professor fins que es resolgui el problema que ho ha disparat.\"},\"cy\":{\"account_settings_fe083453\":\"Gosodiadau Cyfrif\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Rhaid i rybuddion gael eu ffurfweddu ar gyfer y sefydliad. Mae rhybuddion yn nodweddion sy'n cael eu defnyddio'n anaml er mwyn anfon rhybudd at fyfyrwyr, athrawon a gweinyddwr ar gyfer pethau penodol (e.e. dim rhyngweithio rhwng myfyrwyr ac athrawon am 7 diwrnod). Maen nhw’n cael eu gwirio bob dydd a bydd hysbysiadau’n cael eu hanfon at y myfyriwr a/neu’r athro nes bydd y broblem sy’n sbarduno hynny wedi cael ei datrys.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Yn gadael i ddefnyddiwr ffurfweddu negeseuon hysbysu yng Ngosodiadau’r Cwrs.\",\"course_settings_f6d0bbf8\":\"Gosodiadau Cwrs\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Rhaid i’r gosodiad cyfrif hwn gael ei roi ar waith gan Reolwr Llwyddiant Cwsmeriaid. Mae rhybuddion yn nodweddion sy'n cael eu defnyddio'n anaml er mwyn anfon rhybudd at fyfyrwyr, athrawon a gweinyddwr ar gyfer pethau penodol (e.e. dim rhyngweithio rhwng myfyrwyr ac athrawon am 7 diwrnod). Maen nhw’n cael eu gwirio bob dydd a bydd hysbysiadau’n cael eu hanfon at y myfyriwr a/neu’r athro nes bydd y broblem sy’n sbarduno hynny wedi cael ei datrys.\"},\"da\":{\"account_settings_fe083453\":\"Kontoindstillinger\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Varslinger skal konfigureres til institutionen. Varslinger er en sjældent brugt funktion, der er beregnet til at sende en varsling til studerende, lærere eller admins om bestemte udløsere (fx ingen interaktion mellem studerende-lærer i 7 dage). De tjekkes hver dag, og der sendes meddelelser til den studerende og/eller læreren, indtil det udløsende problem udbedres.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Gør det muligt for en bruger at konfigurere varslinger i Fagindstillinger.\",\"course_settings_f6d0bbf8\":\"Fagindstillinger\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Det her er en kontoindstilling, som din kundesuccesmanager skal aktivere. Varslinger er en sjældent brugt funktion, der er beregnet til at sende en varsling til studerende, lærere eller admins om bestemte udløsere (fx ingen interaktion mellem studerende-lærer i 7 dage). De tjekkes hver dag, og der sendes meddelelser til den studerende og/eller læreren, indtil det udløsende problem udbedres.\"},\"da-x-k12\":{\"account_settings_fe083453\":\"Kontoindstillinger\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Varslinger skal konfigureres til institutionen. Varslinger er en sjældent brugt funktion, der er beregnet til at sende en varsling til elever, lærere eller admins om bestemte udløsere (fx ingen interaktion mellem elev-lærer i 7 dage). De tjekkes hver dag, og der sendes meddelelser til eleven og/eller læreren, indtil det udløsende problem udbedres.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Gør det muligt for en bruger at konfigurere varslinger i Fagindstillinger.\",\"course_settings_f6d0bbf8\":\"Fagindstillinger\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Det her er en kontoindstilling, som din kundesuccesmanager skal aktivere. Varslinger er en sjældent brugt funktion, der er beregnet til at sende en varsling til elever, lærere eller admins om bestemte udløsere (fx ingen interaktion mellem elev-lærer i 7 dage). De tjekkes hver dag, og der sendes meddelelser til eleven og/eller læreren, indtil det udløsende problem udbedres.\"},\"de\":{\"account_settings_fe083453\":\"Kontoeinstellungen\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Alarme müssen für die Institution konfiguriert werden. Warnmeldungen sind eine selten benutzte Funktion, die dazu dient, aus beliebigen Gründen eine Benachrichtigung an Schüler, Lehrer oder Administratoren zu senden (z. B. Für 7 Tage keine Schüler-Lehrer-Interaktion). Sie werden jeden Tag abgefragt, und Schülern und/oder Lehrern werden Benachrichtigungen gesendet, bis das auslösende Problem gelöst ist.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Erlaubt dem Benutzer, Warnmeldungen in den Kurseinstellungen zu konfigurieren.\",\"course_settings_f6d0bbf8\":\"Kurseinstellungen\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Dies ist eine Kontoeinstellung, die von einem Kundenerfolgsmanager aktiviert werden muss. Warnmeldungen sind eine selten benutzte Funktion, die dazu dient, aus beliebigen Gründen eine Benachrichtigung an Schüler, Lehrer oder Administratoren zu senden (z. B. Für 7 Tage keine Schüler-Lehrer-Interaktion). Sie werden jeden Tag abgefragt, und Schülern und/oder Lehrern werden Benachrichtigungen gesendet, bis das auslösende Problem gelöst ist.\"},\"el\":{\"account_settings_fe083453\":\"Ρυθμίσεις Λογαρισμού\",\"course_settings_f6d0bbf8\":\"Ρυθμίσεις Μαθήματος\"},\"en-AU\":{\"account_settings_fe083453\":\"Account Settings\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Alerts must be configured for the institution. Alerts are a seldom-used feature designed to send an alert to students, teachers or admins for specific triggers (e.g., no student-teacher interaction for 7 days). They are checked every day, and notifications will be sent to the student and/or the teacher until the triggering problem is resolved.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Allows user to configure alerts in Course Settings.\",\"course_settings_f6d0bbf8\":\"Course Settings\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"This is an account setting that must be enabled by a Customer Success Manager. Alerts are a seldom-used feature designed to send an alert to students, teachers or admins for specific triggers (e.g., no student-teacher interaction for 7 days). They are checked every day, and notifications will be sent to the student and/or the teacher until the triggering problem is resolved.\"},\"en-CA\":{\"account_settings_fe083453\":\"Account Settings\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Alerts must be configured for the institution. Alerts are a seldom-used feature designed to send an alert to students, teachers or admins for specific triggers (e.g., no student-teacher interaction for 7 days). They are checked every day, and notifications will be sent to the student and/or the teacher until the triggering problem is resolved.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Allows user to configure alerts in Course Settings.\",\"course_settings_f6d0bbf8\":\"Course Settings\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"This is an account setting that must be enabled by a Customer Success Manager. Alerts are a seldom-used feature designed to send an alert to students, teachers or admins for specific triggers (e.g., no student-teacher interaction for 7 days). They are checked every day, and notifications will be sent to the student and/or the teacher until the triggering problem is resolved.\"},\"en-GB\":{\"account_settings_fe083453\":\"Account settings\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Alerts must be configured for the institution. Alerts are a seldom-used feature designed to send an alert to students, teachers or admins for specific triggers (e.g. no student-teacher interaction for 7 days). They are checked every day, and notifications will be sent to the student and/or the teacher until the triggering problem is resolved.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Allows user to configure alerts in Course settings.\",\"course_settings_f6d0bbf8\":\"Course settings\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"This is an account setting that must be enabled by a Customer Success Manager. Alerts are a seldom-used feature designed to send an alert to students, teachers or admins for specific triggers (e.g. no student-teacher interaction for 7 days). They are checked every day, and notifications will be sent to the student and/or the teacher until the triggering problem is resolved.\"},\"es\":{\"account_settings_fe083453\":\"Configuraciones de cuenta\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Las alertas deben estar configuradas para la institución. Las alertas son una funcionalidad que se usa raramente y que está diseñada para enviar un alerta a los estudiantes, profesores o administradores para activaciones específicas (por ejemplo, que no haya interacciones entre los estudiantes y los profesores durante 7 días). Se revisan cada día, y las notificaciones se enviarán al estudiante o al profesor hasta que el problema que generó la activación se resuelva.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Permite al usuario configurar alertas en las Configuraciones del curso.\",\"course_settings_f6d0bbf8\":\"Configuraciones del curso\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Esta es una configuración de cuenta que debe ser habilitada por un administrador de satisfacción del cliente. Las alertas son una funcionalidad que se usa raramente y que está diseñada para enviar un alerta a los estudiantes, profesores o administradores para activaciones específicas (por ejemplo, que no haya interacciones entre los estudiantes y los profesores durante 7 días). Se revisan cada día, y las notificaciones se enviarán al estudiante o al profesor hasta que el problema que generó la activación se resuelva.\"},\"fa\":{\"account_settings_fe083453\":\"تنظیمات حساب\",\"course_settings_f6d0bbf8\":\"تنظیمات درس\"},\"fi\":{\"account_settings_fe083453\":\"Tilin asetukset\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Hälytykset täytyy konfiguroida laitokselle. Hälytykset on harvoin tarvittava ominaisuus, joka lähettää hälytyksiä opiskelijoille, opettajille tai pääkäyttäjille kun tietty ehto toteutuu (esim. kun opiskelijalla ja opettajalla ei ole ollut vuorovaikutusta 7 päivään). Ehtojen täyttyminen tarkistetaan joka päivä, ja hälytysilmoitus lähetetään opiskelijalle ja/tai opettajalle, kunnes hälytyksen laukaissut tilanne on ratkaistu.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Sallii käyttäjän asettaa hälytyksiä kurssin asetuksissa.\",\"course_settings_f6d0bbf8\":\"Kurssiasetukset\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Tämä on tilitason asetus, jonka vain Customer Success Manager voi ottaa käyttöön. Hälytykset on harvoin tarvittava ominaisuus, joka lähettää hälytyksiä opiskelijoille, opettajille tai pääkäyttäjille kun tietty ehto toteutuu (esim. kun opiskelijalla ja opettajalla ei ole ollut vuorovaikutusta 7 päivään). Ehtojen täyttyminen tarkistetaan joka päivä, ja hälytysilmoitus lähetetään opiskelijalle ja/tai opettajalle, kunnes hälytyksen laukaissut tilanne on ratkaistu.\"},\"fr\":{\"account_settings_fe083453\":\"Paramètres de comptes\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Les alertes doivent être configurées pour l’établissement. Les alertes sont une fonction rarement utilisée pour envoyer une alerte aux élèves, aux enseignants ou aux administrateurs pour des déclencheurs spécifiques (par exemple, pas d'interaction élève / enseignant pendant 7 jours). Celles-ci sont vérifiées chaque jour, et des notifications sont envoyées à l’élève et / ou l’enseignant jusqu’à ce que le problème soit résolu.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Permet à l'utilisateur de configurer les alertes dans les Paramètres du cours.\",\"course_settings_f6d0bbf8\":\"Paramètres du cours\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Il s'agit d'un paramètre de compte qui doit être activé par un Responsable succès client. Les alertes sont une fonction rarement utilisée pour envoyer une alerte aux élèves, aux enseignants ou aux administrateurs pour des déclencheurs spécifiques (par exemple, pas d'interaction élève / enseignant pendant 7 jours). Celles-ci sont vérifiées chaque jour, et des notifications sont envoyées à l’élève et / ou l’enseignant jusqu’à ce que le problème soit résolu.\"},\"fr-CA\":{\"account_settings_fe083453\":\"Paramètres du compte\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Les alertes doivent être configurées pour l'établissement. Les alertes sont une fonctionnalité rarement utilisée conçue pour envoyer une alerte pour les étudiants, les enseignants ou les administrateurs pour des déclencheurs spécifiques (p. ex., aucune interaction étudiant-enseignant pour 7 jours). Ceux-ci sont vérifiés chaque jour, et des notifications sont envoyées à l’étudiant ou l’enseignant jusqu’à ce que le problème soit résolu.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Permet à l’utilisateur de configurer les alertes dans les Paramètres de cours.\",\"course_settings_f6d0bbf8\":\"Paramètres du cours\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"C'est un paramètre de compte qui doit être activé par a Gestionnaire de réussite du client. Les alertes sont une fonctionnalité rarement utilisée conçue pour envoyer une alerte pour les étudiants, les enseignants ou les administrateurs pour des déclencheurs spécifiques (p. ex., aucune interaction étudiant-enseignant pour 7 jours). Ceux-ci sont vérifiés chaque jour, et des notifications sont envoyées à l’étudiant ou l’enseignant jusqu’à ce que le problème soit résolu.\"},\"he\":{\"account_settings_fe083453\":\"הגדרות חשבון\",\"course_settings_f6d0bbf8\":\"הגדרות קורס\"},\"ht\":{\"account_settings_fe083453\":\"Konfigirasyon Kont\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Alèt yo dwe konfigire pou enstitisyon an. Avètisman yo se yon fonksyon yo pa itilize souvan ke yo fè pou voye avètisman bay elèv, pwofesè oswa administratè pou deklanchè espesyal (pa ezanp, elèv-pwofesè pa fè okenn aktivite depi 7 jou). Yo verifye yo chak jou epi yo voye notifikasyon bay elèv la ak/oswa pwofesè jiskaske pwoblèm deklanchè a rezoud.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Pèmèt itilizatè a konfigire alèt nan Paramèt Kou yo.\",\"course_settings_f6d0bbf8\":\"Paramèt Kou\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Se yon paramèt kont ki dwe aktive pa yon Responsab Reyisit Kliyan. Avètisman yo se yon fonksyon yo pa itilize souvan ke yo fè pou voye avètisman bay elèv, pwofesè oswa administratè pou deklanchè espesyal (pa ezanp, elèv-pwofesè pa fè okenn aktivite depi 7 jou). Yo verifye yo chak jou epi yo voye notifikasyon bay elèv la ak/oswa pwofesè jiskaske pwoblèm deklanchè a rezoud.\"},\"hu\":{\"account_settings_fe083453\":\"Fiókbeállítások\",\"course_settings_f6d0bbf8\":\"Kurzusbeállítások\"},\"hy\":{\"account_settings_fe083453\":\"Հաշիվների գրառումների կարգաբերումներ\",\"course_settings_f6d0bbf8\":\"Դասընթացի կարգաբերումներ\"},\"is\":{\"account_settings_fe083453\":\"Stillingar reiknings\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Viðvaranir verða að vera stilltar fyrir stofnunina. Viðvaranir er eiginleiki sem er sjaldan notaður sem er hannaður til að senda út viðvaranir til nemenda, kennara eða kerfisstjóra fyrir sérstaka orsakavalda (t.d. engin samskipti á milli nemanda-kennara í 7 daga). Þær eru skoðaðar á hverjum degi og tilkynningar verða sendar til nemanda og/eða kennara þar til leyst er úr vandamálinu sem orsakaði viðvörunina.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Gerir notanda kleift að fínstilla viðvaranir í námskeiðsstillingum.\",\"course_settings_f6d0bbf8\":\"Stillingar námskeiðs\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Þessa reikningsstillingu verður að vera virkjuð af þjónustustjóra. Viðvaranir er eiginleiki sem er sjaldan notaður sem er hannaður til að senda út viðvaranir til nemenda, kennara eða kerfisstjóra fyrir sérstaka orsakavalda (t.d. engin samskipti á milli nemanda-kennara í 7 daga). Þær eru skoðaðar á hverjum degi og tilkynningar verða sendar til nemanda og/eða kennara þar til leyst er úr vandamálinu sem orsakaði viðvörunina.\"},\"it\":{\"account_settings_fe083453\":\"Impostazioni account\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Gli avvisi devono essere configurati per l’istituto. Gli avvisi sono una funzione raramente utilizzata progettata per inviare un avviso a studenti, insegnanti o amministratori per attivazioni specifiche (ad es. nessuna interazione con studenti-insegnanti per 7 giorni). Vengono controllati ogni giorno e le notifiche verranno inviate allo studente e/o all'insegnante finché il problema di attivazione non verrà risolto.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Consente all'utente di configurare avvisi in Impostazioni corso.\",\"course_settings_f6d0bbf8\":\"Impostazioni corso\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Si tratta di un'impostazione a livello di account che deve essere attivata da un Customer Success Manager. Gli avvisi sono una funzione raramente utilizzata progettata per inviare un avviso a studenti, insegnanti o amministratori per attivazioni specifiche (ad es. nessuna interazione con studenti-insegnanti per 7 giorni). Vengono controllati ogni giorno e le notifiche verranno inviate allo studente e/o all'insegnante finché il problema di attivazione non verrà risolto.\"},\"ja\":{\"account_settings_fe083453\":\"アカウント設定\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"教育機関向けにアラートを設定しなければなりません。アラートは、受講生、講師、または管理者に特定のトリガ（たとえば、受講生と講師が7日間やり取りなし）のアラートを送信するようにデザインされる、めったに使用されない機能です。毎日チェックされ、誘発される問題が解決されるまで、受講生および/または講師に通知が送信されます。\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"ユーザーがコース設定でアラートを設定できるようにします。\",\"course_settings_f6d0bbf8\":\"コース設定\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"これは、カスタマーマネジャーによって有効にされなければならないアカウント設定です。アラートは、受講生、講師、または管理者に特定のトリガ（たとえば、受講生と講師が7日間やり取りなし）のアラートを送信するようにデザインされる、めったに使用されない機能です。毎日チェックされ、誘発される問題が解決されるまで、受講生および/または講師に通知が送信されます。\"},\"ko\":{\"account_settings_fe083453\":\"계정 설정\",\"course_settings_f6d0bbf8\":\"과목 설정\"},\"mi\":{\"account_settings_fe083453\":\"Pūkete Tautuhinga\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Matohi me whakahohe mo te whakanōhanga Ko ngā whakatūpatotanga he mahinga kore noa e whakamahia ana ki te tuku i te matāra ki ngā ākonga, ki ngā kaiako, ki ngā kaiwhakahaere hoki mo ngā kaitautoko taketake (hei tauira, kaore he ākonga / kaiako whakahoahoa mo te mahi mo ngā ra 7). Ka tirohia ia ra, ka tukuna he whakamöhiotanga ki te äkonga, ki te kaiako ränei ka whakatauhia te raruraru.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Ka whakāetia te kaiwhakamahi ki te whirihora whakatūpato i roto i ngā akoranga tautuhinga.\",\"course_settings_f6d0bbf8\":\"Tautuhinga akoranga\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"He pūkete tautuhinga tēnei me whakahohe e tō Kiritaki Angitu Kaiwhakahaere. Ko ngā whakatūpatotanga he mahinga kore noa e whakamahia ana ki te tuku i te matāra ki ngā ākonga, ki ngā kaiako, ki ngā kaiwhakahaere hoki mo ngā kaitautoko taketake (hei tauira, kaore he ākonga / kaiako whakahoahoa mo te mahi mo ngā ra 7). Ka tirohia ia ra, ka tukuna he whakamöhiotanga ki te äkonga, ki te kaiako ränei ka whakatauhia te raruraru.\"},\"nb\":{\"account_settings_fe083453\":\"Kontoinnstillinger\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Varsler må konfigureres for institusjonen Varslinger er en lite brukt funksjon designet for å sende et varsel til studenter, lærere eller administratorer for spesifikke utløsere (f.eks. ingen lærer-student-interaksjon i løpet av 7 dager). De sjekkes hver dag og varslinger vil sendes ut til studenten og/eller læreren frem til det utløsende problemet er løst.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Lar en bruker konfigurere varslinger i emneinnstillinger.\",\"course_settings_f6d0bbf8\":\"Innstillinger for emne\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Dette er en kontoinnstilling som må aktiveres av kundesuksessansvarlig. Varslinger er en lite brukt funksjon designet for å sende et varsel til studenter, lærere eller administratorer for spesifikke utløsere (f.eks. ingen lærer-student-interaksjon i løpet av 7 dager). De sjekkes hver dag og varslinger vil sendes ut til studenten og/eller læreren frem til det utløsende problemet er løst.\"},\"nb-x-k12\":{\"account_settings_fe083453\":\"Kontoinnstillinger\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Varsler må konfigureres for institusjonen Varslinger er en lite brukt funksjon designet for å sende et varsel til elever, lærere eller administratorer for spesifikke utløsere (f.eks. ingen lærer-elev-interaksjon i løpet av 7 dager). De sjekkes hver dag og varslinger vil sendes ut til eleven og/eller læreren frem til det utløsende problemet er løst.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Lar en bruker konfigurere varslinger i faginnstillinger.\",\"course_settings_f6d0bbf8\":\"Innstillinger for fag\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Dette er en kontoinnstilling som må aktiveres av kundesuksessansvarlig. Varslinger er en lite brukt funksjon designet for å sende et varsel til elever, lærere eller administratorer for spesifikke utløsere (f.eks. ingen lærer-elev-interaksjon i løpet av 7 dager). De sjekkes hver dag og varslinger vil sendes ut til eleven og/eller læreren frem til det utløsende problemet er løst.\"},\"nl\":{\"account_settings_fe083453\":\"Accountinstellingen\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Waarschuwingen moeten voor het instituut worden geconfigureerd. De zelden gebruikte waarschuwingsfunctie is bedoeld om cursisten, docenten of beheerders een waarschuwing te sturen voor specifieke triggers (bijvoorbeeld geen interactie van cursist en docent gedurende 7 dagen). De criteria worden elke dag gecontroleerd en er worden meldingen verstuurd naar de cursist en/of de docent totdat het triggerprobleem is opgelost.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Hiermee kan een gebruiker waarschuwingen configureren in Cursusinstellingen.\",\"course_settings_f6d0bbf8\":\"Cursusinstellingen\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Dit is een accountinstelling die door een Customer Success Manager moet worden ingeschakeld. De zelden gebruikte waarschuwingsfunctie is bedoeld om cursisten, docenten of beheerders een waarschuwing te sturen voor specifieke triggers (bijvoorbeeld geen interactie van cursist en docent gedurende 7 dagen). De criteria worden elke dag gecontroleerd en er worden meldingen verstuurd naar de cursist en/of de docent totdat het triggerprobleem is opgelost.\"},\"nn\":{\"account_settings_fe083453\":\"Kontoinnstillingar\",\"course_settings_f6d0bbf8\":\"Emneinnstillingar\"},\"pl\":{\"account_settings_fe083453\":\"Ustawienia konta\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Alerty należy skonfigurować dla instytucji. Alerty są rzadko używaną funkcją, która służy do wysyłania alertów do uczestników, nauczycieli lub administratorów w szczególnych sytuacjach (np. brak kontaktu z uczestnikiem/nauczycielem przez 7 dni). Są sprawdzane co dzień, natomiast powiadomienia są wysyłane do uczestnika i/lub nauczyciela aż do chwili rozwiązania problemu aktywującego alert.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Pozwala użytkownikowi na konfigurowanie alertów w Ustawieniach kursu.\",\"course_settings_f6d0bbf8\":\"Ustawienia kursu\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Jest to ustawienie konta, które musi włączyć Menedżer sukcesu klienta. Alerty są rzadko używaną funkcją, która służy do wysyłania alertów do uczestników, nauczycieli lub administratorów w szczególnych sytuacjach (np. brak kontaktu z uczestnikiem/nauczycielem przez 7 dni). Są sprawdzane co dzień, natomiast powiadomienia są wysyłane do uczestnika i/lub nauczyciela aż do chwili rozwiązania problemu aktywującego alert.\"},\"pt\":{\"account_settings_fe083453\":\"Configurações de conta\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Os alertas devem ser configurados para a instituição. Os alertas são um recurso usado raramente para enviar um alerta a alunos, professores ou administradores para acionadores específicos (por exemplo, nenhuma interação aluno/professor por 7 dias). Eles são verificados todos os dias e as notificações serão enviadas ao aluno e/ou ao professor até que o problema de acionamento seja resolvido.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Permite ao utilizador configurar alertas nas Configurações da disciplina.\",\"course_settings_f6d0bbf8\":\"Configurações da disciplina\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Essa é uma definição de conta que deve ser ativada pelo seu Gestor de Sucesso do Cliente. Os alertas são um recurso usado raramente para enviar um alerta a alunos, professores ou administradores para acionadores específicos (por exemplo, nenhuma interação aluno/professor por 7 dias). Eles são verificados todos os dias e as notificações serão enviadas ao aluno e/ou ao professor até que o problema de acionamento seja resolvido.\"},\"pt-BR\":{\"account_settings_fe083453\":\"Configurações da conta\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Os alertas devem ser configurados para a instituição. Alertas são um recurso raramente utilizados projetados para enviar um alerta a alunos, professores ou administradores para disparadores específicos (por ex., nenhuma interação do aluno/professor por 7 dias). Eles são verificados todos os dias, e notificações serão enviadas ao aluno e/ou professor até que o problema que esteja disparando o alerta seja resolvido.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Permite que o usuário configure alertas nas configurações do curso.\",\"course_settings_f6d0bbf8\":\"Configurações do curso\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Essa é uma configuração da conta que deve ser ativada pelo seu Gerente de Sucesso do Cliente. Alertas são um recurso raramente utilizados projetados para enviar um alerta a alunos, professores ou administradores para disparadores específicos (por ex., nenhuma interação do aluno/professor por 7 dias). Eles são verificados todos os dias, e notificações serão enviadas ao aluno e/ou professor até que o problema que esteja disparando o alerta seja resolvido.\"},\"ru\":{\"account_settings_fe083453\":\"Настройки учетных записей\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Для учреждения необходимо настроить оповещения. Предупреждения — редко используемая функция, предназначенная для отправки оповещений студентам, преподавателям или администраторам в силу определенных причин возникновения этих предупреждений (например, отсутствует взаимодействие между студентом и преподавателем в течение 7 дней). Они проверяются каждый день, при этом уведомления направляются студенту и (или) преподавателю до тех пор, пока не будет устранена причин возникновения этих предупреждений.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Позволяет пользователю настраивать предупреждения в настройках курса.\",\"course_settings_f6d0bbf8\":\"Настройки курса\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Это настройка учетной записи, которая должна быть активирована менеджером службы поддержки клиентов. Предупреждения — редко используемая функция, предназначенная для отправки оповещений студентам, преподавателям или администраторам в силу определенных причин возникновения этих предупреждений (например, отсутствует взаимодействие между студентом и преподавателем в течение 7 дней). Они проверяются каждый день, при этом уведомления направляются студенту и (или) преподавателю до тех пор, пока не будет устранена причин возникновения этих предупреждений.\"},\"sl\":{\"account_settings_fe083453\":\"Nastavitve računa\",\"course_settings_f6d0bbf8\":\"Nastavitve predmeta\"},\"sv\":{\"account_settings_fe083453\":\"Kontoinställningar\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Notiser måste konfigureras för lärosätet. Notiser är en sällan använd funktion som designats för att skicka en notis till studenter, lärare eller administratörer vid vissa tillfällen (t.ex. ingen interaktion mellan student och lärare under 7 dagar). De kontrolleras varje dag och aviseringar skickas till studenten och/eller läraren tills problemet som utlöste aviseringen har åtgärdats.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Tillåter användare att konfigurera notiser i Kursinställningar.\",\"course_settings_f6d0bbf8\":\"Kursinställningar\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Detta är en kontoinställning som måste aktiveras av en Kundframgångschef (Customer Success Manager). Notiser är en sällan använd funktion som designats för att skicka en notis till studenter, lärare eller administratörer vid vissa tillfällen (t.ex. ingen interaktion mellan student och lärare under 7 dagar). De kontrolleras varje dag och aviseringar skickas till studenten och/eller läraren tills problemet som utlöste aviseringen har åtgärdats.\"},\"sv-x-k12\":{\"account_settings_fe083453\":\"Kontoinställningar\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"Notiser måste konfigureras för institutionen. Notiser är en sällan använd funktion som designats för att skicka en notis till elever, lärare eller administratörer vid vissa tillfällen (t.ex. ingen interaktion mellan elev och lärare under 7 dagar). De kontrolleras varje dag och aviseringar skickas till eleven och/eller läraren tills problemet som utlöste aviseringen har åtgärdats.\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"Tillåter användare att konfigurera notiser i Kursinställningar.\",\"course_settings_f6d0bbf8\":\"Kursinställningar\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"Detta är en kontoinställning som måste aktiveras av en Kundframgångschef (Customer Success Manager). Notiser är en sällan använd funktion som designats för att skicka en notis till elever, lärare eller administratörer vid vissa tillfällen (t.ex. ingen interaktion mellan elev och lärare under 7 dagar). De kontrolleras varje dag och aviseringar skickas till eleven och/eller läraren tills problemet som utlöste aviseringen har åtgärdats.\"},\"tr\":{\"account_settings_fe083453\":\"Hesap Ayarları\",\"course_settings_f6d0bbf8\":\"Ders Ayarları\"},\"uk\":{\"account_settings_fe083453\":\"Налаштування облікового запису\",\"course_settings_f6d0bbf8\":\"Налаштування курсу\"},\"zh-Hans\":{\"account_settings_fe083453\":\"帐户设置\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"必须为该机构配置警报。警报是一种很少使用的功能，用于在满足特定触发条件时向学生、教师或管理员发送警报（例如，7天内没有学生 - 教师互动）。每天都会对其进行检查，并向学生和/或教师发送通知，直到触发问题得到解决。\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"允许用户在“课程设置”中配置警报。\",\"course_settings_f6d0bbf8\":\"课程设置\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"该帐户设置必须由客户成功经理启用。警报是一种很少使用的功能，用于在满足特定触发条件时向学生、教师或管理员发送警报（例如，7天内没有学生 - 教师互动）。每天都会对其进行检查，并向学生和/或教师发送通知，直到触发问题得到解决。\"},\"zh-Hant\":{\"account_settings_fe083453\":\"帳戶設定\",\"alerts_must_be_configured_for_the_institution_aler_43bbacb1\":\"必須設定使用於機構的提醒。提醒是個比較少用的功能，用於向學生、教師或管理員就特定觸發事件（如：過去 7 天沒有師生互動）傳送提醒。每天都會進行檢查，並將通知傳送給學生和/或教師，直到觸發問題得到解決。\",\"allows_user_to_configure_alerts_in_course_settings_c6b938ab\":\"允許使用者於課程設定中配置提醒。\",\"course_settings_f6d0bbf8\":\"課程設定\",\"this_is_an_account_setting_that_must_be_enabled_by_8ced660\":\"這是必須由客戶服務經理啟用的帳戶設定。提醒是個比較少用的功能，用於向學生、教師或管理員就特定觸發事件（如：過去 7 天沒有師生互動）傳送提醒。每天都會進行檢查，並將通知傳送給學生和/或教師，直到觸發問題得到解決。\"}}"));
